import React from "react";
import '../styles/mail_list/MailList.css'
import MailCard from "./MailCard.jsx";
import { Link } from "react-router-dom";

const list = [
    {
        id:1,
        name: "Даня Заикин",
        content: "Привет, пока!"
    },
    {
        id:2,
        name:"Данил Орлов",
        content: "Нужно сделать функционал для файлов!"
    },
    {
        id:3,
        name:"Глеб Зворыкин",
        content: "Понял, посылаю письмо сам себе("
    }
]

function MailList() {
    return (
        <div className="mail-list">
            {list.map(mail=>(
                <MailCard name={mail.name} id={mail.id} content={mail.content}>
                    <Link path="/mail/:id"/>
                </MailCard>
            ))}
        </div>
    )
}


export default MailList;
